PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE attacks (
	char VARCHAR(20) NOT NULL, 
	move VARCHAR(20) NOT NULL, 
	start INTEGER, 
	"end" INTEGER, 
	total INTEGER, 
	iasa INTEGER, 
	ld_fl_spec INTEGER, 
	stun INTEGER, 
	percent FLOAT, 
	percent_weak FLOAT, 
	notes VARCHAR(200), 
	auto_cancel_s INTEGER, 
	auto_cancel_e INTEGER, 
	land_lag INTEGER, 
	cancel_lag INTEGER, 
	PRIMARY KEY (char, move)
);
CREATE TABLE grabs (
	char VARCHAR(20) NOT NULL, 
	type VARCHAR(10) NOT NULL, 
	start INTEGER, 
	total INTEGER, 
	notes VARCHAR(200), 
	PRIMARY KEY (char, type)
);
CREATE TABLE throws (
	char VARCHAR(20) NOT NULL, 
	type VARCHAR(10) NOT NULL, 
	start INTEGER, 
	"end" INTEGER, 
	total INTEGER, 
	percent FLOAT, 
	notes VARCHAR(200), 
	PRIMARY KEY (char, type)
);
CREATE TABLE dodges (
	char VARCHAR(20) NOT NULL, 
	type VARCHAR(20) NOT NULL, 
	start INTEGER, 
	inv_end INTEGER, 
	total INTEGER, 
	notes VARCHAR(200), 
	PRIMARY KEY (char, type)
);
CREATE TABLE misc (
	char VARCHAR(20) NOT NULL, 
	weight INTEGER, 
	gravity FLOAT, 
	walk_speed FLOAT, 
	run_speed FLOAT, 
	wd_length INTEGER, 
	wd_frames INTEGER, 
	jump_squat INTEGER, 
	wall_jump BOOLEAN, 
	notes VARCHAR(200), 
	PRIMARY KEY (char), 
	CHECK (wall_jump IN (0, 1))
);
COMMIT;
